import React from "react";
import react,{Component} from "react";



class App extends React.Component{
    render(){
        return(
            <div>
                hello world
            </div>
        )
    }
}
class Anas extends react.Component{
    state={
        gender:"hello i am a strong male"
    }
    render(){
        return(          
            <div>
                {this.state.gender}
            </div>
    )
    }
}

// export default App;
export{App,Anas};
